// src/components/StockIndicators.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const StockIndicators = () => {
  const [indicatorsData, setIndicatorsData] = useState(null);
  const [selectedTicker, setSelectedTicker] = useState('AATM'); // Default ticker
  const [tickers, setTickers] = useState(['AAL', 'AASM', 'AATM', 'ABL', 'ABOT', 'ABSON']); // Example tickers

  const fetchIndicatorsData = (ticker) => {
    axios.get(`http://localhost:5000/api/stock-indicators/${ticker}`)
      .then(response => {
        setIndicatorsData(response.data);
      })
      .catch(error => {
        console.error('Error fetching stock indicators', error);
      });
  };

  useEffect(() => {
    fetchIndicatorsData(selectedTicker);
  }, [selectedTicker]);

  const handleTickerChange = (e) => {
    setSelectedTicker(e.target.value);
  };

  return (
    <div>
      <h2>Stock Indicators for {selectedTicker}</h2>
      
      <label htmlFor="tickerSelect">Select Ticker: </label>
      <select id="tickerSelect" value={selectedTicker} onChange={handleTickerChange}>
        {tickers.map(ticker => (
          <option key={ticker} value={ticker}>
            {ticker}
          </option>
        ))}
      </select>

      {indicatorsData ? (
        <div>
          <h3>Indicators:</h3>
          <p>RSI: {indicatorsData.rsi}</p>
          <p>MACD: {indicatorsData.macd}</p>
          <p>Bollinger Bands: {indicatorsData.bollinger}</p>
          {/* Add more indicators as needed */}
        </div>
      ) : (
        <p>Loading indicators...</p>
      )}
    </div>
  );
};

export default StockIndicators;
